import React, { Component } from 'react';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';
import { videoTagString, VideoTag } from 'react-video-tag'

class Flights extends Component {
    render() {

        let { flight } = this.props;
        const MyComponent = () => <VideoTag src={flight.links.video_link} poster={flight.video_link} />
        return(

     <div>
     {MyComponent}

<Card style={{ width: '18rem', backgroundColor: 'lightgray' }}>

  <Card.Img variant="top" src={flight.article_link}/>
  <Card.Body>
    <Card.Title>{flight.mission_name}</Card.Title>
    <Card.Text>
      {flight.details}
    </Card.Text>
    <Button variant="primary">Go somewhere</Button>
  </Card.Body>
</Card>
</div>

      )
    }
}

export default Flights;
